'use strict';
let AGetPersistentSessionCommand = require('./AGetPersistentSessionCommand.js');
let MessageType = require('./MessageType.js');
let TransportMessageType = require('./TransportMessageType.js');
//@@DocBrief("The command for getting price session")
class GetPriceSessionCommand extends AGetPersistentSessionCommand {
    constructor() {
        super();
        this.commandName = "GetPriceSessionCommand";
    }
    getRealMessageType() {
        return MessageType.GetPriceSession;
    }
    getEmptyMessageType() {
        return MessageType.GetEmptyPriceSession;
    }
    getTransportMessageType() {
        return TransportMessageType.GetPriceSessionStatus;
    }
}
module.exports = GetPriceSessionCommand
